import React from "react";
import "./App.css"

function App() {
  return (
    <div className="App">
      <p>Hello!</p>
      <table>
        <tr>
          <th>Nama</th>
          <th>Nomor Telepon</th>
          <th>Umur</th>          
        </tr>
        <tr>
          <td>John</td>
        </tr>
        <tr>
          <td>Elsa</td>
        </tr>
      </table>
    </div>
  );
}

export default App;
